pragma solidity ^0.4.17;
import "./CarrierContact.sol";
import "./CarrierDotInfo.sol";

contract Carrier {

    address public owner;
    address[] public contacts;
    address public dot_information;

    function Carrier() public {
        owner = msg.sender;
    }

    function addContact(
        bytes32 _firstName,
        bytes32 _lastName,
        bytes32 _jobTitle,
        bytes32 _contactType,
        bytes32 _phone,
        bytes32 _mobilePhone,
        bytes32 _fax,
        bytes32 _email
    ) public
    {
        require(msg.sender == owner);
        CarrierContact contact = new CarrierContact(
            _firstName,
            _lastName,
            _jobTitle,
            _contactType,
            _phone,
            _mobilePhone,
            _fax,
            _email
        );
        contacts.push(contact);
    }

    function getContacts() public view returns (address[]) {
        return contacts;
    }



    function addDotInfo(
        bytes32 _usDotNumber,
        bytes32 _dbaName,
        bytes32 _legalName,
        bytes32 _streetAddress,
        bytes32 _streetPhone,
        bytes32 _mailingAddress,
        bytes32 _mailingPhone
    ) public
    {
        require(msg.sender == owner);
        dot_information = new CarrierDotInfo(
            _usDotNumber,
            _dbaName,
            _legalName,
            _streetAddress,
            _streetPhone,
            _mailingAddress,
            _mailingPhone
        );
    }

    function getDotNumber() public view returns (bytes32) {
        return CarrierDotInfo(dot_information).usDotNumber();
    }

}
